description:
Our no-budget Canadian-made cyberpunk garage film.

Summary: A crime story set in a post-cyberpunk world. With a killer on the loose, 
targeting the cybernetic underclass, a Marshal from the Unified Cybernetics Foundation works along two Toronto detectives to put an end to the deaths.

And, as a bonus, this is my movie. As in I wrote it, directed it, edited and even ate a gummy octopus on camera. So no RIAA nonsense to worry about.

